-- ----------------------------
--  Table structure for `t_sequence`
-- ----------------------------
DROP TABLE IF EXISTS `t_sequence`;
CREATE TABLE `t_sequence` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `type` varchar(20) DEFAULT NULL COMMENT '序号类型',
  `sequence` char(50) NOT NULL COMMENT '序号值',
  `create_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_system_sequence_unique` (`type`,`sequence`) USING BTREE,
  KEY `index_system_sequence_type` (`type`),
  KEY `index_system_sequence_number` (`sequence`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统序号表';

-- ----------------------------
--  Table structure for `t_television`
-- ----------------------------
DROP TABLE IF EXISTS `t_television`;
CREATE TABLE `t_television` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `url_1` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `url_2` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `url_3` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `type_ids` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_hot` tinyint(1) DEFAULT '0',
  `is_new` tinyint(1) DEFAULT '0',
  `is_recommend` tinyint(1) DEFAULT '0',
  `country` int(11) DEFAULT NULL,
  `province` int(11) DEFAULT NULL,
  `city` int(11) DEFAULT NULL,
  `icon` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bg` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `keyword` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `context` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `hit` int(11) DEFAULT '0',
  `icon_width` int(11) DEFAULT '0',
  `icon_height` int(11) DEFAULT '0',
  `status` int(11) DEFAULT '0',
  `channelid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_type_ids` (`type_ids`) USING HASH
) ENGINE=MyISAM AUTO_INCREMENT=2147483648 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

