DROP TABLE IF EXISTS `t_television_program`;
CREATE TABLE `t_television_program` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tv_id` int(11) NOT NULL,
  `title` varchar(500) COLLATE utf8_unicode_ci NOT NULL,
  `play_at` datetime DEFAULT NULL,
  `url` varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL,
  `play_date` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `play_time` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `type` int(11) DEFAULT '0',
  `end_time` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `content` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `play_times` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
